import React from "react";
import VideoItem from "./VideoItem";

const VideoList = ({videos}) => {
  const List=videos.map(
      (vid)=>{
        return (<VideoItem />)
      }
  );


  return <div>{videos.length}</div>
};

export default VideoList;
